import React from 'react';
import SearchHeader from './SearchHeader';

function PensionDetailLink() {
  return (
    <div>
      <SearchHeader />
      <h3>펜션 상세 페이지입니다.</h3>
    </div>
  );
}

export default PensionDetailLink;
